textOriginal:
Bolsonaro é favorito para vencer no 2o turno. Explico o meu ponto de vista:
a) As eleições de hoje mostraram a força impressionante do Bolsonaro. Só de senadores, formou-se um time de futebol (Romário, Jorge Seif, Rogério Marinho, Damares, Marcos Pontes, Mourão, Sérgio Moro, Coronel Menezes (AM), Magno Malta e Cletinho (MG).
b) O Bolsonarismo se mostrou fortíssimo na região sudeste, onde estão a maioria dos votos. Candidatos alinhados com Bolsonaro, venceram as eleições em Minas Gerais (Zema), Rio de Janeiro (Cláudio Castro) e em São Paulo (Tarcísio de Freitas), os dois primeiros já eleitos em 1o turno. O interior paulista é FORTEMENTE ANTI-PT, e na capital, São Paulo, é de se lembrar que Haddad perdeu em TODOS OS DISTRITOS para o novato João Dória, quando ambos concorreram. O PT perdeu até nos distritos que o PT sermpre vencia;  
c) Tirando os estados do Nordeste, o PT praticamente não ganhou em lugar nenhum do país. Salvo engano, não elegeu um único governador fora do Nordeste;
d) Eu penso que, diferentemente do que é falado na mídia e uma impressão geral, penso que os EUA querem manter Bolsonaro no poder. Falo isso, porque Biden pertence ao mesmo grupo de Barack Obama, que recentemente escreveu uma biografia, onde fala com todas as letras que Lula é corrupto, comparando seu governo aos gângster de NY do início do século XX. Além disso, recentemente vários países da América Latina resolveram eleger presidentes esquerdistas (Chile, Colômbia, Argentina), fora a Venezuela. Essa moçada geralmente se apoia sempre no dinheiro chinês para tudo. E creio que os EUA não vão querer ter praticamente toda uma região, que sempre foi sua área de domínio geopolítico, com o maior país da região, o Brasil, fechado com a China, como ocorria na era petista;
e) vendo a entrevista de Lula agora senti no tom de voz, um claro desânimo. No PT, essa não-eleição de Lula no 1o turno, veio como uma ducha de água fria, um grande anti-clímax. A coisa estava já montada na Paulista hoje à noite para a festa da vitória. O 2o turno cria um desânimo e baixa a moral, fora que as pesquisas agora não serão mais consideradas pela maioria das pessoas, uma vez considerados os grandes erros que ocorreram, o que para muitos mostrou manipulação e fraude.
